import React from 'react'

import Edit from '../assets/img/edit.svg';

function Tasks() {
    return (
        <div className="tasks">
            <h2 className="tasks__title pink">Фронтэнд <img src={Edit} alt="Edit icon"/> </h2>
            <div className="tasks__items">
                <label className="checkbox">
                      <input type="checkbox" />
                </label> 
            </div>
        </div>
    )
}

export default Tasks;
